import {Link} from 'react-router-dom';

const Navbar = () => {
    return ( 
        <nav className="navbar">
            <div className="links">
                
                <a href="/">Goa</a>
                <a href="/mountain">Mountain</a>
                <a href="/beaches">Beaches</a>
                <a href="/bird">Bird</a>
                <a href="/food">Food</a>
            </div>
        </nav>
     );
}
 
export default Navbar;
